import React from "react";

function Home() {
  return (
    <div className="home">
      <img
        className="home__image"
        src="https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/p640x640/101228595_1462520660586424_7573872222639539151_n.jpg?_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=104&_nc_ohc=eTGQ6jC1uu4AX9KIUHq&oh=73d3d8eb6d2ace321eef4e95b536f5de&oe=5F39647F"
        alt=""
      />
    </div>
  );
}

export default Home;
